import React from 'react';

function ContactUsSection() {
  return (
    <>
      <div className="w3-container w3-light-grey">
        <div className="w3-row-padding">
          <div className="w3-padding-16"><span className="w3-xlarge w3-border-teal w3-bottombar" id="contact">Contact Us</span></div>
          <div className="w3-col m6" style={{ display: 'flex', alignItems: 'stretch' }}>
            <form className="w3-container w3-card-4 w3-padding-16 w3-white w3-round-large">
              {/* Form content */}
            </form>
          </div>
          <div className="w3-col m6" style={{ display: 'flex', alignItems: 'stretch' }}>
            <br />
            <img className="w3-image w3-round-large" src="images/coding.jpg" style={{ width: '100%', objectFit: 'cover' }} alt="Coding" />
          </div>
        </div>
      </div>
    </>
  );
}

export default ContactUsSection;
